                   dbo:team ?team .

  # Find the player in that successor season
  ?player a dbo:SoccerPlayer ;
          dbo:team ?team .

  # Find Gary Williams (footballer, born 1960) and his birthplace
  ?garyWilliams a dbo:SoccerPlayer ;
                rdfs:label "Gary Williams"@en ;
                dbo:birthPlace ?birthPlace .

  # Find the native settlement that is English
  ?birthPlace a dbo:Settlement ;
              dbo:country dbr:England .

  # Find the soccer manager of Gary Williams
  ?manager a dbo:SoccerManager ;
           dbo:managedClub ?team ;
           dbo:native ?birthPlace .
}

