PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/property/>
PREFIX res: <http://dbpedia.org/resource/>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>

SELECT ?team WHERE {
  ?player a dbo:SoccerPlayer ;
          dbo:birthDate ?birthDate ;
          dbo:team ?team ;
          dbo:abstract ?abstract .

  ?manager a dbo:SoccerManager ;
           dbo:birthDate ?birthDate ;
           dbo:team ?team .

  FILTER (lang(?abstract) = 'en')

  BIND (res:Eiður_Guðjohnsen as ?eidur)
  BIND (xsd:date("1978-09-15") as ?birthDate)  # Eiður Guðjohnsen's birth date
  BIND (res:FC_Vaduz as ?fcVaduz)
}

SELECT ?parent WHERE {
  # Get the child of Archduchess Margaret of Austria
  ?margaret a dbo:Person ;
             rdfs:label "Margaret of Austria"@en ;
             dbo:child ?childMargaret .

  # Get the parent of that child
  ?childMargaret dbo:parent ?parent .

  # Get the child of Archduke Joseph Karl of Austria
  ?joseph a dbo:Person ;
           rdfs:label "Joseph Karl of Austria"@en ;
           dbo:child ?childJoseph .

  # Get the parent of the child of Archduke Joseph Karl
  ?childJoseph dbo:parent ?parentJoseph .

  # Get the native of the landmark at elevation 96.0
  ?landmark a dbo:Settlement ;
             dbo:elevation "96.0"^^xsd:float ;
             dbo:native ?native .

  # Get the parent of the native
  ?native dbo:parent ?parentNative .

  # Filter to ensure we are looking for the parent of the child of the parent of Margaret
  FILTER(?parent = ?parentJoseph || ?parent = ?parentNative)
}

